source_string:
The following patches have been removed since the last time you used them.

${patches}

Continue anyways?

translation:
Οι παρακάτω τροποποιήσεις αφαιρέθηκαν από την τελευταία φορά που τις χρησιμοποιήσατε.

${patches}

Συνέχεια παρόλα αυτά;

source_string:
The version of the app you have selected does not match the suggested version which can lead to unexpected issues. Please use the suggested version.

Selected version: ${selected}
Suggested version: ${suggested}

To continue anyway, disable "Require suggested app version" in the settings.

translation:
Η έκδοση της εφαρμογής που επιλέξατε δεν ταιριάζει με την προτεινόμενη έκδοση αυτό μπορεί να προκαλέσει ανεπιθύμητα θέματα. Παρακαλώ επιλέξτε την εφαρμογή που ταιριάζει με την προτεινόμενη έκδοση.

Επιλεγμένη έκδοση: ${selected}
Προτεινόμενη έκδοση: ${suggested}

Για να προχωρήσετε ούτως ή άλλως, απενεργοποιήστε την «Επιβολή επιλογής της προτεινόμενης έκδοσης εφαρμογής» στις ρυθμίσεις.

source_string:
Some patches require options to be set:

${patches}

Please set them before continuing.

translation:
Κάποιες τροποποιήσεις απαιτούν να ορίζονται κάποιες επιλογές:

${patches}

Παρακαλώ ορίστε τις επιλογές πρώτου συνεχίσετε.

source_string:
Selecting this patch may result in patching errors.

App version: ${packageVersion}
Supported versions:
${supportedVersions}

translation:
Η επιλογή αυτής της τροποποίησης μπορεί να επιφέρει σφάλματα τροποποίησης.

Έκδοση εφαρμογής: ${packageVersion}
Υποστηριζόμενες εκδόσεις: ${supportedVersions}

Πρόκειται να απενεργοποιήσετε τη δυνατότητα αλλαγής των επιλογών τροποποιήσεων.
Οι προεπιλεγμένες επιλογές τροποποιήσεων θα επαναφερθούν.

Απενεργοποίηση παρόλα αυτά;
